import react from 'react';

const EducationItem = ({startDate, endDate, degree, location, gpa, href}) => {

  return (
    <li className="education__item">
      <span className='education__date'> 
        {endDate ? 
          star
        :
          startDate
        }
        {startDate}: </span>
      <a 
        href={href}
        className='education__degree skills-popup__link-text skills__title--animating'
        target='_blank'
        rel='noreferrer'
      > 
        {degree}
      </a>
      <span className='education__location'> from the ${location}  </span>
      <span className='education__gpa'> ({gpa} GPA). </span>
    </li>
  )
}

export default EducationItem;
